import React, {Component} from 'react';

export default class CVEdit extends Component {

  constructor(props) {
    super(props);

    this.state={
      experience : []
    }
  }

  render() {
    return (
      <div className='mt-5 border-bottom'>
        <h2> CVEdit </h2>
      </div>
    )
  }
}
